<app-objects-table
  [setColumns]="columns"
  [dataSource]="(this.importHistoryService.model | async) || []"
  [canEdit]="canEdit"
  [withEditAbility]="false"
  button1Name="download"
  button2Name="delete"
  (button1callback)="downloadRow($event)"
  (button2callback)="deleteRow($event)"
></app-objects-table>
